import React from 'react'
import { BrowserRouter as Route } from "react-router-dom";
import City from '../../components/City'


const Citypage = ({ match }) => {
    console.log(match)
    return (
        <Route patch={`${match.path}/:id`} component={City} />
    )
}

export default Citypage
